INSERT INTO `provas` (`id`, `nome`, `descricao`, `pergunta`, `pontuacao_maxima`, `tipo_provas_id`) VALUES
(20, 'TRAVESSIA', '⦁	O time deverá construir uma equipe de oito pessoas. Estes Oito membros da equipe a partir de agora serão nomeados como personagens para a realização da vivência, e os demais poderão ajudar como ESTRATEGISTAS para a conclusão da vivência. Será proibido o comportamento de tentativas e erros, e sim ações estratégicas para atingir o resultado.\r\nOs personagens serão:\r\n⦁	Gerente;\r\n⦁	Matriz;\r\n⦁	Vendedor;\r\n⦁	Cliente;\r\n⦁	Transporte;\r\n⦁	Produto;\r\n⦁	CD;\r\n⦁	Operador de Cadastro\r\nO objetivo é conduzir todos os personagens para o outro lado da margem obedecendo as seguintes regras:\r\n⦁	Somente o GERENTE, a MATRIZ e o VENDEDOR sabem pilotar o barco;\r\n⦁	A MATRIZ não poderá ficar sozinha com o TRANSPORTE, e o PRODUTO SEM O GERENTE;\r\n⦁	O GERENTE não poderá ficar sozinho com o CD e o OPERADOR DE CADASTRO sem a MATRIZ;\r\n⦁	O CLIENTE não poderá ficar sozinho com nenhum outro integrante da GAZIN, sem a presença do VENDEDOR.\r\nO bote tem capacidade para transportar apenas 2 pessoas por vez. Você pode ir e vir com as pessoas quantas vezes for necessário.\r\nCada pessoa que a equipe conseguir transportar e estiver presente na outra margem até o final da vivência, valerá 100 pontos.\r\nO tempo para realizar esta vivência será de 30 minutos contados a partir da primeira leitura dessas regras. \r\n', 'SUGESTÃO DE PERGUNTAS PARA PARTILHA\r\n\r\n⦁Qual o significado desta vivencia relacionada ao nosso trabalho?\r\n\r\n⦁Quais estratégias foram usadas para realizar esta vivencia?\r\n\r\n⦁Quem faz o papel de conduzir o barco em seu trabalho? E na sua família?\r\n\r\n⦁Que nota você se daria para o seu posicionamento no momento da execução desta atividade?\r\n', 1000, 1),
(21, 'CONFIANÇA', '⦁	Todo o time deverá participar desta vivência segurando a lona aberta no LAGO para suporte aos demais colaboradores. \r\nUma pessoa por vez devera caminhar sobre a PLATAFORMA e se lançar de COSTAS em DIREÇÃO A LONA.\r\nTodo o time deverá dar suporte para o colaborador que irá se lança afim de dar segurança para quem irá passar pelo processo.\r\nSe uma pessoa da equipe NÃO SE LANÇAR toda a equipe não terá concluindo a vivência.\r\nO tempo para realizar esta vivência será de 30 minutos contados a partir da primeira leitura dessas regras. ', 'SUGESTÃO DE PERGUNTAS PARA PARTILHA\r\n⦁	Qual o significado desta vivencia para o nosso dia-dia\r\n⦁	Me considero uma pessoa confiável? \r\n⦁	Meu time pode se apoiar em mim e contar comigo? \r\n⦁	Qual o papel do operador de cadastro nesta vivencia?\r\n⦁	Tenho sido um apoio para as pessoas quando elas precisam de mim?\r\nMedo de errar\r\nAutonomia\r\nSegurança/insegurança', 1000, 1),
(22, 'CIRCUITO', '⦁	Todos os colaboradores deverão se posicionar sobre a plataforma para realização desta vivencia.  Somente no início da vivencia se poderá dar suporte para quem vai subir. Cada colaborador receberá um estilingue e 3 munições para realizar os tiros. O tiro só pode ser realizado no momento em que todos os colaboradores estiverem sobre o tronco. O colaborador pode realizar seus tiros em qualquer alvo e de qualquer ponto desde que esteja sobre o tronco e que se utilize apenas as 3 munições recebidas no início. O colaborador que não possuir mais munição deve permanecer sobre o tronco até o término de todos os tiros ou até que o tempo da vivência se esgote. Deve ser realizado um tiro por vez apenas, não podendo ter 2 ou mais colaboradores atirando ao mesmo tempo. Caso o colaborador toque o chão durante a realização da vivência, apenas ele, deverá reiniciar a vivência, e a equipe só poderá atirar nos alvos, a partir do momento que o colaborador que reiniciou a vivência, esteja sobre o tronco. Cada alvo possui um valor financeiro, que será contabilizado caso a equipe o acerte. O valor do alvo acertado será somado na pontuação final da vivência. O tempo para realizar esta vivência será de 30 minutos contados a partir da primeira leitura dessas regras. \r\n\r\n', '⦁	SUGESTÃO DE PERGUNTAS PARA PARTILHA\r\n⦁	Qual o significado desta vivencia?\r\n⦁	Quando penso em meu departamento, sinto que todos estão conectados?\r\n⦁	O que você pode fazer que ainda não fez para atingir o alvo?\r\n⦁	Você tem dificuldade em perder? Qual o sentimento quando erro o alvo no trabalho?\r\n', 1000, 1),
(23, 'FONTE DA AGUA', '⦁	Todo o time deverá participar desta vivência, com o objetivo de encher o tambor de agua. Cada participante deve segurar imutavelmente na ponta da CORDA que está amarrada na superfície do balde. Cada participante deve utilizar apenas uma mão para segurar na corda, deixando a outra mão livre.\r\nO time deve levar o balde até o LAGO, encher e deverá caminhar TODOS JUNTOS até o RECEPIENTE que será demonstrado pelo facilitador. \r\nAo chegar lá deve despejar no recipiente até a borda. A equipe poderá ir e vir quantas vezes for necessário para a conclusão da vivencia.  A partir do momento em que se iniciou a vivência, o balde não poderá mais tocar o chão.\r\nSe uma pessoa da equipe SOLTAR a mão da corda TODOS devem reiniciar a vivencia do ponto inicia e o recipiente deverá retornar ao ponto zero (vazio).\r\nO tempo para realizar esta vivência será de 30 minutos contados a partir da primeira leitura dessas regras. ', 'SUGESTÃO DE PERGUNTAS PARA PARTILHA\r\n⦁	Qual o significado desta vivencia relacionada ao nosso trabalho?\r\n⦁	O que faltou para que esta vivencia fosse realizada com maior assertividade?\r\n⦁	Como poderemos relacionar esta atividade com os processos do dia-dia ?', 1000, 1),
(24, 'CONSTRUÇÃO DE VALOR', '⦁	Esta é a vivencia CONSTRUÇÃO DE VALOR, todo o time deverá ajudar na construção de uma casa formada pelos materiais a sua frente. \r\nO time deve escolher a partir de agora:\r\n⦁	Quatro PARTICIPANTES para serem PILARES.\r\nEstes PILARES deveram ser apoio na construção da casa para que a CASA não toque o solo.\r\nSe a ESTRUTURA tocar o solo, TODA a equipe deve reiniciar do ponto inicial.\r\nOs PILARES devem ficar no silencio a partir do momento em que estiverem posicionados com a base.\r\nOs PILARES não podem ajudar fisicamente a CONSTRUÇÃO da CASA, apenas irão SEGURAR A BASE. \r\nCaso o TIME resolva realizar as trocas dos PILARES, poderá ser feito, desde que reinicie a vivencia do ponto INICIAL.\r\nO tempo para realizar esta vivência será de 30 minutos contados a partir da primeira leitura dessas regras. ', 'SUGESTÃO DE PERGUNTAS PARA PARTILHA\r\n⦁Qual o significado desta vivencia relacionada ao nosso trabalho?\r\n⦁O que faltou finalizar melhor esta vivencia?\r\n⦁Quais são os pilares da operação que você desenvolve no seu trabalho?\r\n⦁Qual a vivencia lá em casa que você ainda não superou?\r\n', 1000, 1),
(25, 'TRANSFORMAÇÃO', '⦁	Toda equipe deverá encontrar a lona que está dentro da caixa e se posicionar sobre a mesma.\r\nNenhum participante poderá pisar fora da lona durante a atividade, pois será considerado uma queda. O time deverá usar a estratégia de inverter a lona do lado \"a\" para o lado \"b\", sem que nenhum participante toque o solo.\r\nSe um participante tocar o solo todo o time deverá reiniciar o processo.\r\nO tempo para realizar esta vivência será de 20 minutos contados a partir da primeira leitura dessas regras.\r\n', 'SUGESTÃO DE PERGUNTAS PARA PARTILHA\r\n⦁	Qual o significado desta vivencia relacionada ao nosso trabalho?\r\n⦁	Como podemos relacionar esta vivencia com o papel do operador de cadastro?\r\n⦁	Qual a dificuldade de encontrar o caminho para mudar?\r\n', 1000, 1),
(26, 'RODA DA VIDA', '⦁	Todo o time deverá se posicionar, em frente aos círculos e atravessar um a um de um lado para o outro, sem tocar bordas do círculo. \r\nAqueles que ainda não passaram deverão ajudar o colaborador a passar. Somente os que já passaram, poderão ajudar fisicamente o colaborador descer.\r\nSe ao passar pelo círculo o participante tocar as bordas, será considerado uma queda, e deverá reiniciar a atividade. Se o colaborador tocar por três vezes a borda do círculo toda a equipe deverá recomeçar a atividade.\r\nEsta vivência terá duração de 30 minutos, contados a partir da primeira leitura dessas regras.\r\n', 'SUGESTÃO DE PERGUNTAS PARA PARTILHA\r\n⦁Qual o significado desta vivencia para nossa vida?\r\n⦁Vocês acham que cumpriram esta vivencia? Por que?\r\n⦁O que faltou para atingir o resultado?\r\n⦁Como relacionar esta vivencia com nossas práticas do dia - dia\r\n', 1000, 1),
(27, 'Café da Manhã', 'Esperando ', 'Esperando', 1000, 3),
(28, 'Almoço e Jantar', 'Esperando', 'Esperando', 1000, 3),
(29, 'Estilingue', 'Esperando', 'Esperando', 1000, 2);

